import React from "react";

function PollQuestion() {
  return (
    <div style={{ height: "22vh", width: "100%", marginTop: "2vh" }}>
      <p style={{ fontWeight: "600", fontSize: "1.3em", letterSpacing: "1px" }}>
        Q.1 Question place holder for analysis ?{" "}
      </p>

      <div
        style={{
          display: "flex",
          gap: "4vw",
          marginLeft: "2vw",
          marginTop: "4vh",
        }}
      >
        <div
          style={{
            color: "#474444",
            fontWeight: "600",
            backgroundColor: "white",
            borderRadius: "5px",
            paddingTop: "4vh",
            paddingBottom: "2vh",
            paddingLeft: "3vw",
            width: "15vw",
          }}
        >
          <p>60 <span></span>Option 1</p>
        </div>

        <div
          style={{
            color: "#474444",
            fontWeight: "600",
            height: "10vh",
            width: "20vw",
            backgroundColor: "white",
            borderRadius: "5px",
            textAlign: "center",
            paddingTop: "1.3vh",
          }}
        >
          <p>23 Option 2</p>
        </div>

        <div
          style={{
            color: "#474444",
            fontWeight: "600",
            height: "10vh",
            width: "20vw",
            backgroundColor: "white",
            borderRadius: "5px",
            textAlign: "center",
            paddingTop: "1.3vh",
          }}
        >
          <p>45 Option 3</p>
        </div>

        <div
          style={{
            color: "#474444",
            fontWeight: "600",
            height: "10vh",
            width: "20vw",
            backgroundColor: "white",
            borderRadius: "5px",
            textAlign: "center",
            paddingTop: "1.3vh",
          }}
        >
          <p>11 Option 4</p>
        </div>
      </div>
    </div>
  );
}

export default PollQuestion;
